    false,nt"url": null,nt"notes": "This annual narrative report for Tewaukon
    WMD outlines Refuge accomplishments during the 1985 calendar year. The report begins
    with a summary of the year's highlights and weather conditions. Land acquisition
    is covered. The report includes a planning section which discusses management planning,
    compliance with environmental and cultural resource mandates, and research and investigations.
    Refuge administration is outlined; information about personnel, youth programs,
    volunteer programs, funding, safety, and technical assistance is given. Habitat
    management is also covered; subjects include wetlands, forests, croplands, grasslands,
    grazing, haying, fire management, pest control, and WPA easements. The wildlife
    section of the report discusses endangered and threatened species, waterfowl, shorebirds,
    raptors, game mammals, and wildlife propagation. The public uses of the Refuge described
    in this report include interpretive programs, hunting, trapping, and law enforcement.
    The equipment and facilities section of the report provides information about new
    construction, rehabilitation, and equipment replacement. Cooperative programs and
    items of interest are provided at the end.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
